# 步长BUG

function unPackHeader($src,$key='')
{
    if(strlen($src) < 0x20)
    {
        exit("Protocol Error!\n");
    }
    else
    {
        $nCur = 0;
        if($src[$nCur] == unpack('C',"\xbf")[1])        # array [1] => 191
        {
            $nCur += 1;                                 # 跳过协议标志位
        }

        $nLenHeader     = getbytes($src)[$nCur] >> 2;                 # 包头长度
        $bUseCompressed = (getbytes($src)[$nCur] & 0x3 == 1);         # 包体是否使用压缩算法:01使用,02不使用

        $nCur += 1;
        $nDecryptType  = getbytes($src)[$nCur] >> 4;   #解密算法(固定为AES解密): 05 aes解密 / 07 rsa解密
        $nLenCookie    = getbytes($src)[$nCur] & 0xf;  # cookie长度
        $nCur += 1;
        $nCur += 4;                          #服务器版本(当前固定返回4字节0)

        $uin = 0;  #uin

        $nCur += 4;

        $cookie_temp = substr($src,$nCur,$nCur+$nLenCookie);

        $cookie = "";

        if($cookie_temp != $cookie)
        {
            $cookie = $cookie_temp;
        }

        $nCur += $nLenCookie;

        $body = $src;

        decompress_and_aesDecrypt($body,'NuQta2Hdb5erEmiY');
    }
}
